import{_ as e,a as c}from"./app.f83d96fd.js";var t="/document/assets/touch-class-instance.16b4d937.png";const o={},d=c('<h1 id="\u5BF9\u8C61\u7684\u751F\u547D\u5468\u671F" tabindex="-1"><a class="header-anchor" href="#\u5BF9\u8C61\u7684\u751F\u547D\u5468\u671F" aria-hidden="true">#</a> \u5BF9\u8C61\u7684\u751F\u547D\u5468\u671F</h1><p>\u4E00\u65E6\u4E00\u4E2A\u7C7B\u88AB\u88C5\u8F7D\u3001\u8FDE\u63A5\u548C\u521D\u59CB\u5316\uFF0C\u5B83\u5C31\u968F\u65F6\u53EF\u4EE5\u88AB\u4F7F\u7528\u3002\u7A0B\u5E8F\u53EF\u4EE5\u8BBF\u95EE\u5B83\u7684\u9759\u6001\u5B57\u6BB5\uFF0C\u8C03\u7528\u5B83\u7684\u9759\u6001\u65B9\u6CD5\uFF0C\u6216\u8005\u521B\u5EFA\u5B83\u7684\u5B9E\u4F8B\u3002\u4F5C\u4E3AJava\u7A0B\u5E8F\u5458\u6709\u5FC5\u8981\u4E86\u89E3Java\u5BF9\u8C61\u7684\u751F\u547D\u5468\u671F\u3002</p><h2 id="\u7C7B\u5B9E\u4F8B\u5316" tabindex="-1"><a class="header-anchor" href="#\u7C7B\u5B9E\u4F8B\u5316" aria-hidden="true">#</a> \u7C7B\u5B9E\u4F8B\u5316</h2><p>\u5728Java\u7A0B\u5E8F\u4E2D\uFF0C\u7C7B\u53EF\u4EE5\u88AB\u660E\u786E\u6216\u9690\u542B\u5730\u5B9E\u4F8B\u5316\u3002\u660E\u786E\u7684\u5B9E\u4F8B\u5316\u7C7B\u6709\u56DB\u79CD\u9014\u5F84\uFF1A</p><ul><li>\u660E\u786E\u8C03\u7528<code>new</code>\u3002</li><li>\u8C03\u7528<code>Class</code>\u6216\u8005<code>java.lang.reflect.Constructor</code>\u5BF9\u8C61\u7684<code>newInstance</code>\u65B9\u6CD5\u3002</li><li>\u8C03\u7528\u4EFB\u4F55\u73B0\u6709\u5BF9\u8C61\u7684<code>clone</code>\u3002</li><li>\u901A\u8FC7<code>java.io.ObjectInputStream.getObject()</code>\u53CD\u5E8F\u5217\u5316\u3002</li></ul><p>\u9690\u542B\u7684\u5B9E\u4F8B\u5316\uFF1A</p><ul><li>\u53EF\u80FD\u662F\u4FDD\u5B58\u547D\u4EE4\u884C\u53C2\u6570\u7684<code>String</code>\u5BF9\u8C61\u3002</li><li>\u5BF9\u4E8EJava\u865A\u62DF\u673A\u88C5\u8F7D\u7684\u6BCF\u4E2A\u7C7B\uFF0C\u90FD\u4F1A\u6697\u4E2D\u5B9E\u4F8B\u5316\u4E00\u4E2AClass\u5BF9\u8C61\u6765\u4EE3\u8868\u8FD9\u4E2A\u7C7B\u578B</li><li>\u5F53Java\u865A\u62DF\u673A\u88C5\u8F7D\u4E86\u5728\u5E38\u91CF\u6C60\u4E2D\u5305\u542B<code>CONSTANT_String_info</code>\u5165\u53E3\u7684\u7C7B\u7684\u65F6\u5019\uFF0C\u5B83\u4F1A\u521B\u5EFA\u65B0\u7684<code>String</code>\u5BF9\u8C61\u6765\u8868\u793A\u8FD9\u4E9B\u5E38\u91CF\u5B57\u7B26\u4E32\u3002</li><li>\u6267\u884C\u5305\u542B\u5B57\u7B26\u4E32\u8FDE\u63A5\u64CD\u4F5C\u7B26\u7684\u8868\u8FBE\u5F0F\u4F1A\u4EA7\u751F\u65B0\u7684\u5BF9\u8C61\u3002</li></ul><p>Java\u7F16\u8BD1\u5668\u4E3A\u5B83\u7F16\u8BD1\u7684\u6BCF\u4E2A\u7C7B\u81F3\u5C11\u751F\u6210\u4E00\u4E2A\u5B9E\u4F8B\u521D\u59CB\u5316\u65B9\u6CD5\u3002\u5728Java class\u6587\u4EF6\u4E2D\uFF0C\u8FD9\u4E2A\u65B9\u6CD5\u88AB\u79F0\u4E3A<code>&lt;init&gt;</code>\u3002\u9488\u5BF9\u6E90\u4EE3\u7801\u4E2D\u6BCF\u4E2A\u7C7B\u7684\u6784\u9020\u65B9\u6CD5\uFF0CJava\u7F16\u8BD1\u5668\u90FD\u4F1A\u4EA7\u751F\u4E00\u4E2A<code>&lt;init&gt;()</code>\u65B9\u6CD5\u3002\u5982\u679C\u7C7B\u6CA1\u6709\u660E\u786E\u7684\u58F0\u660E\u4EFB\u4F55\u6784\u9020\u65B9\u6CD5\uFF0C\u7F16\u8BD1\u5668\u4F1A\u9ED8\u8BA4\u4EA7\u751F\u4E00\u4E2A\u65E0\u53C2\u6570\u7684\u6784\u9020\u65B9\u6CD5\uFF0C\u5B83\u4EC5\u4EC5\u8C03\u7528\u7236\u7C7B\u7684\u65E0\u53C2\u6784\u9020\u65B9\u6CD5\u3002</p><p>\u4E00\u4E2A<code>&lt;init&gt;()</code>\u4E2D\u53EF\u80FD\u5305\u542B\u4E09\u79CD\u4EE3\u7801\uFF1A\u8C03\u7528\u53E6\u4E00\u4E2A<code>&lt;init&gt;()</code>\u3001\u5B9E\u73B0\u5BF9\u4EFB\u4F55\u5B9E\u4F8B\u53D8\u91CF\u7684\u521D\u59CB\u5316\u3001\u6784\u9020\u65B9\u6CD5\u4F53\u7684\u4EE3\u7801\u3002</p><p>\u5982\u679C\u6784\u9020\u65B9\u6CD5\u660E\u786E\u7684\u8C03\u7528\u4E86\u540C\u4E00\u4E2A\u7C7B\u4E2D\u7684\u53E6\u4E00\u4E2A\u6784\u9020\u65B9\u6CD5(<code>this()</code>)\uFF0C\u90A3\u4E48\u5B83\u5BF9\u5E94\u7684<code>&lt;init&gt;()</code>\u7531\u4E24\u90E8\u5206\u7EC4\u6210\uFF1A</p><ul><li>\u4E00\u4E2A\u540C\u7C7B\u7684<code>&lt;init&gt;()</code>\u7684\u8C03\u7528\u3002</li><li>\u5B9E\u73B0\u4E86\u5BF9\u5E94\u6784\u9020\u65B9\u6CD5\u7684\u65B9\u6CD5\u4F53\u7684\u5B57\u8282\u7801\u3002</li></ul><blockquote><p>\u5728\u5B83\u5BF9\u5E94\u7684<code>&lt;init&gt;()</code>\u65B9\u6CD5\u4E2D\u4E0D\u4F1A\u6709\u7236\u7C7B\u7684<code>&lt;init&gt;()</code>\uFF0C\u4F46\u4E0D\u4EE3\u8868\u4E0D\u4F1A\u8C03\u7528\u7236\u7C7B\u7684<code>&lt;init&gt;()</code>\uFF0C\u56E0\u4E3A<code>this()</code>\u4E2D\u4E5F\u4F1A\u8C03\u7528\u7236\u7C7B<code>&lt;init&gt;()</code></p></blockquote><p>\u5982\u679C\u6784\u9020\u65B9\u6CD5\u4E0D\u662F\u901A\u8FC7\u4E00\u4E2A<code>this()</code>\u8C03\u7528\u5F00\u59CB\u7684\uFF0C\u800C\u4E14\u8FD9\u4E2A\u5BF9\u8C61\u4E0D\u662F<code>Object</code>\uFF0C<code>&lt;init&gt;()</code>\u5219\u6709\u4E09\u90E8\u5206\u7EC4\u6210\uFF1A</p><ul><li>\u4E00\u4E2A\u7236\u7C7B\u7684<code>&lt;init&gt;()</code>\u8C03\u7528\u3002<em>\u5982\u679C\u8FD9\u4E2A\u7C7B\u662F<code>Object</code>,\u5219\u6CA1\u6709\u8FD9\u4E2A\u90E8\u5206</em></li><li>\u4EFB\u610F\u5B9E\u4F8B\u53D8\u91CF\u521D\u59CB\u5316\u65B9\u6CD5\u7684\u5B57\u8282\u7801\u3002</li><li>\u5B9E\u73B0\u4E86\u5BF9\u5E94\u6784\u9020\u65B9\u6CD5\u7684\u65B9\u6CD5\u4F53\u7684\u5B57\u8282\u7801\u3002</li></ul><p>\u5982\u679C\u6784\u9020\u65B9\u6CD5\u660E\u786E\u7684\u8C03\u7528\u7236\u7C7B\u7684\u6784\u9020\u65B9\u6CD5<code>super()</code>\u5F00\u59CB\uFF0C\u5B83\u7684<code>&lt;init&gt;()</code>\u4F1A\u8C03\u7528\u5BF9\u5E94\u7236\u7C7B\u7684<code>&lt;init&gt;()</code>\u3002\u6BD4\u5982\uFF0C\u5982\u679C\u4E00\u4E2A\u6784\u9020\u65B9\u6CD5\u660E\u786E\u7684\u8C03\u7528<code>super(int,String)</code>\u5F00\u59CB\uFF0C\u5BF9\u5E94\u7684<code>&lt;init&gt;()</code>\u4F1A\u4ECE\u8C03\u7528\u7236\u7C7B\u7684<code>&lt;init&gt;(int,String)</code>\u65B9\u6CD5\u5F00\u59CB\u3002<strong>\u5982\u679C\u6784\u9020\u65B9\u6CD5\u6CA1\u6709\u660E\u786E\u5730\u4ECE<code>this()</code>\u6216<code>super()</code>\u5F00\u59CB\uFF0C\u5BF9\u5E94\u7684<code>&lt;init&gt;()</code>\u9ED8\u8BA4\u4F1A\u8C03\u7528\u7236\u7C7B\u7684\u65E0\u53C2<code>&lt;init&gt;()</code>\u3002</strong></p><h2 id="\u5783\u573E\u6536\u96C6\u548C\u5BF9\u8C61\u7684\u7EC8\u7ED3" tabindex="-1"><a class="header-anchor" href="#\u5783\u573E\u6536\u96C6\u548C\u5BF9\u8C61\u7684\u7EC8\u7ED3" aria-hidden="true">#</a> \u5783\u573E\u6536\u96C6\u548C\u5BF9\u8C61\u7684\u7EC8\u7ED3</h2><p>\u7A0B\u5E8F\u53EF\u4EE5\u660E\u786E\u6216\u9690\u542B\u7684\u4E3A\u5BF9\u8C61\u5206\u914D\u5185\u5B58\uFF0C\u4F46\u4E0D\u80FD\u660E\u786E\u7684\u91CA\u653E\u5185\u5B58\u3002\u4E00\u4E2A\u5BF9\u8C61\u4E0D\u518D\u4E3A\u7A0B\u5E8F\u5F15\u7528\uFF0C\u865A\u62DF\u673A\u5FC5\u987B\u56DE\u6536\u90A3\u90E8\u5206\u5185\u5B58\u3002</p><h2 id="\u5378\u8F7D\u7C7B" tabindex="-1"><a class="header-anchor" href="#\u5378\u8F7D\u7C7B" aria-hidden="true">#</a> \u5378\u8F7D\u7C7B</h2><p>\u5728\u5F88\u591A\u65B9\u9762\uFF0CJava\u865A\u62DF\u673A\u4E2D\u7C7B\u7684\u751F\u547D\u5468\u671F\u548C\u5BF9\u8C61\u7684\u751F\u547D\u5468\u671F\u5F88\u76F8\u4F3C\u3002\u5F53\u7A0B\u5E8F\u4E0D\u518D\u4F7F\u7528\u67D0\u4E2A\u7C7B\u7684\u65F6\u5019\uFF0C\u53EF\u4EE5\u9009\u62E9\u5378\u8F7D\u5B83\u4EEC\u3002</p><blockquote><p>\u7C7B\u7684\u5783\u573E\u6536\u96C6\u548C\u5378\u8F7D\u503C\u6240\u4EE5\u5728Java\u865A\u62DF\u673A\u4E2D\u5F88\u91CD\u8981\uFF0C\u662F\u56E0\u4E3AJava\u7A0B\u5E8F\u53EF\u4EE5\u5728\u8FD0\u884C\u65F6\u901A\u8FC7\u7528\u6237\u81EA\u5B9A\u4E49\u7684\u7C7B\u88C5\u8F7D\u5668\u88C5\u8F7D\u7C7B\u578B\u6765\u52A8\u6001\u7684\u6269\u5C55\u7A0B\u5E8F\u3002\u6240\u6709\u88AB\u88C5\u8F7D\u7684\u7C7B\u578B\u90FD\u5728\u65B9\u6CD5\u533A\u5360\u636E\u5185\u5B58\u7A7A\u95F4\u3002</p></blockquote><p>Java\u865A\u62DF\u673A\u901A\u8FC7\u5224\u65AD\u7C7B\u662F\u5426\u5728\u88AB\u5F15\u7528\u6765\u8FDB\u884C\u5783\u573E\u6536\u96C6\u3002\u5224\u65AD\u52A8\u6001\u88C5\u8F7D\u7684\u7C7B\u7684<code>Class</code>\u5B9E\u4F8B\u5728\u6B63\u5E38\u7684\u5783\u573E\u6536\u96C6\u8FC7\u7A0B\u4E2D\u662F\u5426\u53EF\u89E6\u53CA\u6709\u4E24\u79CD\u65B9\u5F0F\uFF1A</p><ul><li>\u5982\u679C\u7A0B\u5E8F\u4FDD\u6301\u975E<code>Class</code>\u5B9E\u4F8B\u7684\u660E\u786E\u5F15\u7528\u3002</li><li>\u5982\u679C\u5728\u5806\u4E2D\u8FD8\u5B58\u5728\u4E00\u4E2A\u53EF\u89E6\u53CA\u7684\u5BF9\u8C61\uFF0C\u5728\u65B9\u6CD5\u533A\u4E2D\u5B83\u7684\u7C7B\u578B\u6570\u636E\u6307\u5411\u4E00\u4E2A<code>Class</code>\u5B9E\u4F8B\u3002</li></ul><p><img src="'+t+'" alt=""></p>',23);function i(a,l){return d}var r=e(o,[["render",i]]);export{r as default};
